<details>
  <summary>
  拉取并覆盖 Pull and override
  </summary>
  <fieldset>
    <legend>拉取服务端最新完整内容覆盖本地所有内容 Pull the latest complete content from the server to cover all local content</legend>
    <div>普通同步没法更新插件和导入的内容，如果你在电脑端更新或安装了插件，则需要在移动端点下面的按钮做一次完整拉取。</div>
    <div>If you have updated or installed the plugin on your computer, you will need to do a full pull on the mobile side by clicking the button below.</div>
    <div>请慎重点击，本地若有未同步内容将丢失！如果确保本地没有未同步内容，则可以放心拉取。</div>
    <div>Please click carefully, local unsynced content will be lost if there is any! If you make sure there is no unsynced content locally, you can pull it without worry.</div>
    <$button>
      <div>{{!!name}}</div>
      <div>拉取内容覆盖本地 Pull content to cover local</div>
      <$action-sendmessage $message="tw-mobile-sync-download-full-html" />
    </$button>
  </fieldset>
</details>
</$list>
"},"$:/plugins/linonetwo/tw-mobile-sync/ui/ServerItemCopyTemplate":{"title":"$:/plugins/linonetwo/tw-mobile-sync/ui/ServerItemCopyTemplate","type":"text/vnd.tiddlywiki","text":"<$button class="tw-mobile-sync-copy-button">
  <div>复制</div>
  <div>Copy</div>
  <$action-createtiddler name={{{ [{!!name}addsuffix[copy]] }}} $template={{!!title}}>
    <$action-navigate $to=<<createTiddler-title>>/>
  </$action-createtiddler>
</$button>
"},"$:/plugins/linonetwo/tw-mobile-sync/ui/ServerItemViewTemplate":{"title":"$:/plugins/linonetwo/tw-mobile-sync/ui/ServerItemViewTemplate","type":"text/vnd.tiddlywiki","text":"<div class="tw-mobile-sync-server-list-item">
  <div style="display: flex; flex-direction: column;">
    <h3 style="margin-top: 0;">
      <$link to={{!!title}}>
        <$text text={{!!name}}/>
      </$link>
    </h3>
    <div style="margin-bottom: 10px;">{{!!ipAddress}}:{{!!port}}</div>
    <!-- we use text as status field -->
    <div>{{!!text}}</div>
  </div>

  <$reveal type="nomatch" state=<<currentTiddler>> text="onlineActive" class="tw-mobile-sync-sync-reveal">
    <$button class="tw-mobile-sync-sync-button">
      <div><$text text={{!!name}}/></div>
      <div>启用同步并立即同步</div>
      <div>Enable and Sync Now</div>
      <$action-sendmessage $message="tw-mobile-sync-set-active-server-and-sync" title={{!!title}} />
    </$button>
  </$reveal>

  <$reveal type="match" state=<<currentTiddler>> text="onlineActive" class="tw-mobile-sync-sync-reveal">
    <$button class="tw-mobile-sync-sync-button">
      <div><$text text={{!!name}}/></div>
      <div>立即同步</div>
      <div>Sync Now</div>
      <$action-sendmessage $message="tw-mobile-sync-sync-start" />
    </$button>
  </$reveal>

</div>
"},"$:/plugins/linonetwo/tw-mobile-sync/ui/ServerList":{"title":"$:/plugins/linonetwo/tw-mobile-sync/ui/ServerList","type":"text/vnd.tiddlywiki","text":"<div class="tw-mobile-sync-server-list">
  <$list filter="[prefix[$:/state/tw-mobile-sync/server/]] -[[$:/state/tw-mobile-sync/server/new]] -[[$:/state/tw-mobile-sync/server/new/scan-qr-widget-open]]">
    <div class="tw-mobile-sync-server-list-item">
      {{||$:/plugins/linonetwo/tw-mobile-sync/ui/ServerItemViewTemplate}}
      {{||$:/plugins/linonetwo/tw-mobile-sync/ui/ServerItemCopyTemplate}}
    </div>
  </$list>
</div>

<div style="display: flex; flex-direction: row;">
  <div class="tw-mobile-sync-new-server-field-fields-container-outer">
    <fieldset>
      <legend>智能识别黏贴框 Smart Identify Sticky Box</legend>

      <div class="tw-mobile-sync-new-server-field-fields-container">
        <$edit-text tiddler="$:/state/tw-mobile-sync/server/new" field="text" default="" />

        <div class="tw-mobile-sync-new-server-field-fields-buttons">
          <$button>
            智能识别 Smart Identify
            <$action-sendmessage $message="tw-mobile-sync-smart-recognize-ip-address" $param="$:/state/tw-mobile-sync/server/new"/>
          </$button>

          <$reveal type="nomatch" state="$:/state/tw-mobile-sync/server/new/scan-qr-widget-open" text="true">
            <$button>
              扫二维码 Scan QR
              <$action-setfield $tiddler="$:/state/tw-mobile-sync/server/new/scan-qr-widget-open" text="true" />
            </$button>
          </$reveal>
          <$reveal type="match" state="$:/state/tw-mobile-sync/server/new/scan-qr-widget-open" text="true">
            <$button>
              停止扫码 Stop Scan
              <$action-setfield $tiddler="$:/state/tw-mobile-sync/server/new/scan-qr-widget-open" text="false" />
            </$button>
          </$reveal>
        </div>
      </div>

      <$reveal type="match" state="$:/state/tw-mobile-sync/server/new/scan-qr-widget-open" text="true">
        <$ScanQRWidget outputTiddlerTitle="$:/state/tw-mobile-sync/server/new" />
      </$reveal>

    </fieldset>
    <fieldset>
      <legend>服务器名 Server Name</legend>
      <$edit-text tiddler="$:/state/tw-mobile-sync/server/new" field="name" default="" />
    </fieldset>
    <fieldset>
      <legend>服务器IP Server IP</legend>
      <$edit-text tiddler="$:/state/tw-mobile-sync/server/new" field="ipAddress" default="" />
    </fieldset>
    <fieldset>
      <legend>服务器端口 Server Port</legend>
      <$edit-text tiddler="$:/state/tw-mobile-sync/server/new" field="port" default="" />
    </fieldset>
  </div>
  <$button style="width: 160px; margin-top: 10px;">
    <div>新增服务器</div>
    <div>Add New</div>
    <$action-createtiddler
      $basetitle={{{ [<now "YYYY-MM-DD-0hh0mm0ss">] +[addprefix[$:/state/tw-mobile-sync/server/]] }}}
      text="offline"
      name={{$:/state/tw-mobile-sync/server/new!!name}}
      caption={{$:/state/tw-mobile-sync/server/new!!name}}
      ipAddress={{$:/state/tw-mobile-sync/server/new!!ipAddress}}
      port={{$:/state/tw-mobile-sync/server/new!!port}}
      lastSync=<<now "[UTC]YYYY0MM0DD0hh0mm0ssXXX">>
    />
    <$action-setfield $tiddler="$:/state/tw-mobile-sync/server/new" text="" name="" ipAddress="" port="" />
  </$button>
</div>

<div>
  {{$:/plugins/linonetwo/tw-mobile-sync/ui/DownloadFullHtml}}
</div>
"},"$:/plugins/linonetwo/tw-mobile-sync/ui/SidebarField":{"title":"$:/plugins/linonetwo/tw-mobile-sync/ui/SidebarField","type":"text/vnd.tiddlywiki","text":"<fieldset class="tw-mobile-sync-sicebar-fieldset">
  <legend>与桌面端同步 Sync With Desktop</legend>

  <div class="tw-mobile-sync-server-list-item">
    {{{[prefix[$:/state/tw-mobile-sync/server/]field:text[onlineActive]] ~[prefix[$:/state/tw-mobile-sync/server/]field:text[online]first[]]||$:/plugins/linonetwo/tw-mobile-sync/ui/ServerItemViewTemplate}}}
  </div>

  [[服务器列表|$:/plugins/linonetwo/tw-mobile-sync/ui/ServerList]]

</fieldset>
"},"$:/plugins/linonetwo/tw-mobile-sync/ui/SidebarFragment":{"title":"$:/plugins/linonetwo/tw-mobile-sync/ui/SidebarFragment","type":"text/vnd.tiddlywiki","tags":"$:/tags/SideBarSegment","text":"<!-- only display plugin fragment in Tiddloid, which will use content scheme to load -->
<$reveal type="match" state="$:/info/url/protocol" text="content:">
  {{$:/plugins/linonetwo/tw-mobile-sync/ui/SidebarField}}
</$reveal>
"},"$:/plugins/linonetwo/tw-mobile-sync/ui/style.css":{"title":"$:/plugins/linonetwo/tw-mobile-sync/ui/style.css","tags":"$:/tags/Stylesheet","type":"text/css","text":".tw-mobile-sync-server-list{padding-left:0;max-width:500px;overflow:auto;overflow:overlay}.tw-mobile-sync-sync-button{width:100%;height:100px;display:flex;flex-direction:column;justify-content:center;align-items:center;max-width:300px;min-width:175px}.tw-mobile-sync-copy-button{height:100px;display:flex;flex-direction:column;justify-content:center;align-items:center;margin-left:10px!important}.tw-mobile-sync-sync-reveal{margin-left:20px}.tw-mobile-sync-new-server-field-fields-container-outer input,.tw-mobile-sync-new-server-field-fields-container-outer textarea{width:100%}.tw-mobile-sync-new-server-field-fields-container-outer{display:flex;flex-direction:column;width:340px}.tw-mobile-sync-new-server-field-fields-container{display:flex;flex-direction:row;justify-content:center;align-items:center}.tw-mobile-sync-new-server-field-fields-buttons{display:flex;flex-direction:column;justify-content:center;align-items:center}@media (max-width:535px){.tw-mobile-sync-new-server-field-fields-container{flex-direction:column}.tw-mobile-sync-new-server-field-fields-buttons{width:100%;flex-direction:row;justify-content:space-between;margin-top:10px}}.tw-mobile-sync-sicebar-fieldset{display:flex;flex-direction:column;justify-content:center;align-items:center}.tw-mobile-sync-server-list-item{display:flex;flex-direction:row;align-items:center;justify-content:space-between;min-width:400px}"}}}
